import React, { useEffect, useState } from "react";
import API from "../api";

const Gallery = () => {
  const [designs, setDesigns] = useState([]);

  // Add your 9 images into frontend/public/images/ with these exact names (or adjust below):
  // /public/images/gallery1.jpg ... gallery9.jpg
  const staticDesigns = [
    { _id: "g1", imageUrl: "data:image/jpeg;base64,", title: "Luxury Living Room", description: "Elegant neutral palette with layered textures." },
    { _id: "g2", imageUrl: "data:image/jpeg;base64,", title: "Modern Art Space", description: "Clean lines accented by a bold portrait piece." },
    { _id: "g3", imageUrl: "data:image/jpeg;base64,", title: "Eclectic Retro Mix", description: "Warm woods and sculptural vintage forms." },
    { _id: "g4", imageUrl: "data:image/jpeg;base64,", title: "Soft Minimal Lounge", description: "Curved silhouettes in calming earthy tones." },
    { _id: "g5", imageUrl: "data:image/jpeg;base64,", title: "Contemporary Bedroom", description: "Statement headboard with gold accent installation." },
    { _id: "g6", imageUrl: "data:image/jpeg;base64,", title: "Fresh Family Living", description: "Pastel wall with balanced pops of yellow." },
    { _id: "g7", imageUrl: "data:image/jpeg;base64,", title: "Warm Scandinavian Loft", description: "Light oak millwork and soft modular seating." },
    { _id: "g8", imageUrl: "data:image/jpeg;base64,", title: "Grand Curved Lounge", description: "Expansive seating centered on symmetry and light." },
    { _id: "g9", imageUrl: "data:image/jpeg;base64,", title: "Modern Organic Suite", description: "Organic shapes and natural fibers for calm aura." }
  ];

  useEffect(() => {
    API.get("/designs")
      .then((res) => setDesigns(res.data || []))
      .catch(() => {}); // silent fail so static images still show
  }, []);

  // If API returns data, use first 9 of those, else use static set
  const displayedDesigns = (designs && designs.length ? designs : staticDesigns).slice(0, 9).map((d, idx) => ({
    _id: d._id || `item-${idx}`,
    title: d.title || `Design ${idx + 1}`,
    description: d.description || "",
    imageUrl: d.imageUrl || d.image || ""
  }));

  return (
    <div className="container mx-auto py-10">
      <h2 className="text-3xl font-bold mb-8 text-center">Design Gallery</h2>
      <div className="grid grid-cols-1 md:grid-cols-3 gap-8">
        {displayedDesigns.map((d) => (
          <div key={d._id} className="shadow-lg rounded overflow-hidden border border-gray-100 hover:shadow-xl transition">
            <div className="w-full h-64 bg-gray-100 flex items-center justify-center overflow-hidden">
              {d.imageUrl ? (
                <img
                  src={d.imageUrl}
                  alt={d.title}
                  className="w-full h-64 object-cover"
                  loading="lazy"
                />
              ) : (
                <span className="text-sm text-gray-400 px-4 text-center">Add image</span>
              )}
            </div>
            <div className="p-4">
              <h3 className="text-xl font-semibold mb-2">{d.title}</h3>
              {d.description && (
                <p className="text-gray-600 text-sm leading-relaxed">{d.description}</p>
              )}
            </div>
          </div>
        ))}
      </div>
    </div>
  );
};

export default Gallery;
